    [],nt"num_tags": 4,nt"name": "parker-river-national-wildlife-refuge-annual-narrative-report-calendar-year-2006",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Parker
    River National Wildlife Refuge summarizes refuge activities during 2006.  The report
    begins with information about the yearu2019s highlights and climatic conditions.
      Land acquisition- including fee title- is also covered.  The report includes
    a planning section which discusses the CCP, the management plan, public participation,
    compliance with Environmental Resource Mandates, and research/investigations.  Refuge
    administration is outlined; lists of personnel, youth programs, volunteer programs,
    and funding sources are given.  Habitat management is also covered.  Subjects include
    wetlands, forests, fire management, pest control, and special wilderness areas.
     The wildlife section of the report discusses wildlife diversity, endangered/threatened
    species, waterfowl, marsh/water birds, shorebirds, raptors, game animals, animal
    control, banding, and disease prevention.  The public uses of the refuge described
    in this report include general use, outdoor classrooms, interpretive foot trails,
    tours, hunting, fishing, trapping, camping, picnicking, and wildlife observation.
     The equipment and facilities section of the report provides information about
    new construction, rehabilitation, major maintenance, equipment replacement, and
    energy conservation.",nt"owner_org": "4d7ad1cd-3641-420b-8116-e4082f49cd44",nt"extras":
